import React, { Component } from "react";
import { NavLink } from "react-router-dom";

export default class MainBar extends Component {
// -------------------- Main Bar --------------------
  render() {
    return (
      <section className="main_bar">
{/* Title */}
        <h1>NBA</h1>
{/* Logo */}
        <div>LOGO</div>
{/* Players */}
        <NavLink to="/Players">
          <button>Players</button>
        </NavLink>
{/* Teams */}
        <NavLink to="/Teams">
          <button>Teams</button>
        </NavLink>
      </section>
    );
  }
}
